                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u062a\u0639\u0631\u0641\u0647\u200c\u06cc \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u062f\u0631 \u0637\u0648\u0631 \u0632\u0645\u0627\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0646\u062f. \u062f\u0631\u0635\u0648\u0631\u062a \u062a\u063a\u06cc\u06cc\u0631\u060c \u0627\u0632 \u0622\u0646 \u062a\u0627\u0631\u06cc\u062e \u0628\u0647 \u0628\u0639\u062f \u0645\u0648\u062c\u0648\u062f\u06cc \u06a9\u06cc\u0641 \u067e\u0648\u0644 \u06a9\u0627\u0631\u0628\u0631 \u0628\u0631 \u0627\u0633\u0627\u0633 \u062a\u0639\u0631\u0641\u0647\u200c\u06cc \u062c\u062f\u06cc\u062f \u0645\u0635\u0631\u0641 \u062e\u0648\u0627\u0647\u062f \u0634\u062f. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062e\u0648\u062f \u0631\u0627 \u0645\u0648\u0638\u0641 \u0645\u06cc\u200c\u062f\u0627\u0646\u062f \u06a9\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u062a\u0639\u0631\u0641\u0647 \u0631\u0627 \u0627\u0632 \u067e\u06cc\u0634 \u0628\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0627\u0637\u0644\u0627\u0639 \u062f\u0647\u062f."
                            : "\u062a\u0639\u0631\u0641\u0647\u200c\u06cc \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u062f\u0631 \u0637\u0648\u0631 \u0632\u0645\u0627\u0646 \u062a\u063a\u06cc\u06cc\u0631 \u06a9\u0646\u062f. \u062f\u0631\u0635\u0648\u0631\u062a \u062a\u063a\u06cc\u06cc\u0631\u060c \u0627\u0632 \u0622\u0646 \u062a\u0627\u0631\u06cc\u062e \u0628\u0647 \u0628\u0639\u062f \u0645\u0648\u062c\u0648\u062f\u06cc \u06a9\u06cc\u0641 \u067e\u0648\u0644 \u06a9\u0627\u0631\u0628\u0631 \u0628\u0631 \u0627\u0633\u0627\u0633 \u062a\u0639\u0631\u0641\u0647\u200c\u06cc \u062c\u062f\u06cc\u062f \u0645\u0635\u0631\u0641 \u062e\u0648\u0627\u0647\u062f \u0634\u062f. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062e\u0648\u062f \u0631\u0627 \u0645\u0648\u0638\u0641 \u0645\u06cc\u200c\u062f\u0627\u0646\u062f \u06a9\u0647 \u062a\u063a\u06cc\u06cc\u0631 \u062a\u0639\u0631\u0641\u0647 \u0631\u0627 \u0627\u0632 \u067e\u06cc\u0634 \u0628\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0627\u0637\u0644\u0627\u0639 \u062f\u0647\u062f."}
