                          {hasVariant(globalVariants, "screen", "smallMobile")
                            ? "\u06a9\u0627\u0631\u0628\u0631 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u062f \u06a9\u0647 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u062f\u0645\u0627\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a (\u067e\u0644\u062a\u0641\u0631\u0645 \u0627\u062c\u0627\u0631\u0647) \u0646\u06cc\u0633\u062a \u0648 \u062a\u0646\u0647\u0627 \u06cc\u06a9 \u0628\u0633\u062a\u0631 \u0646\u0631\u0645\u200c\u0627\u0641\u0632\u0627\u0631\u06cc \u0628\u0631\u0627\u06cc \u062a\u0633\u0647\u06cc\u0644 \u0627\u0631\u062a\u0628\u0627\u0637 \u0645\u06cc\u0627\u0646 \u00ab\u0645\u06cc\u0632\u0628\u0627\u0646\u0627\u0646\u00bb \u0648 \u00ab\u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627\u06cc \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a\u00bb \u0627\u0633\u062a."
                            : hasVariant(globalVariants, "screen", "mobile")
                            ? "\u06a9\u0627\u0631\u0628\u0631 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u062f \u06a9\u0647 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u062f\u0645\u0627\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a (\u067e\u0644\u062a\u0641\u0631\u0645 \u0627\u062c\u0627\u0631\u0647) \u0646\u06cc\u0633\u062a \u0648 \u062a\u0646\u0647\u0627 \u06cc\u06a9 \u0628\u0633\u062a\u0631 \u0646\u0631\u0645\u200c\u0627\u0641\u0632\u0627\u0631\u06cc \u0628\u0631\u0627\u06cc \u062a\u0633\u0647\u06cc\u0644 \u0627\u0631\u062a\u0628\u0627\u0637 \u0645\u06cc\u0627\u0646 \u00ab\u0645\u06cc\u0632\u0628\u0627\u0646\u0627\u0646\u00bb \u0648 \u00ab\u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627\u06cc \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a\u00bb \u0627\u0633\u062a."
                            : "\u06a9\u0627\u0631\u0628\u0631 \u0645\u06cc\u200c\u067e\u0630\u06cc\u0631\u062f \u06a9\u0647 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u062f\u0645\u0627\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a (\u067e\u0644\u062a\u0641\u0631\u0645 \u0627\u062c\u0627\u0631\u0647) \u0646\u06cc\u0633\u062a \u0648 \u062a\u0646\u0647\u0627 \u06cc\u06a9 \u0628\u0633\u062a\u0631 \u0646\u0631\u0645\u200c\u0627\u0641\u0632\u0627\u0631\u06cc \u0628\u0631\u0627\u06cc \u062a\u0633\u0647\u06cc\u0644 \u0627\u0631\u062a\u0628\u0627\u0637 \u0645\u06cc\u0627\u0646 \u00ab\u0645\u06cc\u0632\u0628\u0627\u0646\u0627\u0646\u00bb \u0648 \u00ab\u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627\u06cc \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a\u00bb \u0627\u0633\u062a."}
