                        "\n\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u062d\u062a\u0631\u0627\u0645\u06cc \u06a9\u0647 \u0628\u0631\u0627\u06cc \u062d\u0631\u06cc\u0645 \u0634\u062e\u0635\u06cc \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0642\u0627\u0626\u0644 \u0627\u0633\u062a\u060c \u0628\u0631\u0627\u06cc \u06cc\u06a9\u067e\u0627\u0631\u0686\u0647\u200c\u0633\u0627\u0632\u06cc \u0648\u0636\u0639\u06cc\u062a \u062a\u0642\u0648\u06cc\u0645 \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647 \u062f\u0631 \u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627 \u0648 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0628\u0631\u062e\u06cc \u0627\u0645\u06a9\u0627\u0646\u0627\u062a\u060c \u0627\u0637\u0644\u0627\u0639\u0627\u062a\u06cc \u0631\u0627 \u0627\u0632 \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0645\u06cc\u200c\u06a9\u0646\u062f \u062a\u0627 \u0628\u062a\u0648\u0627\u0646\u062f \u062e\u062f\u0645\u0627\u062a\u06cc \u0627\u062e\u062a\u0635\u0627\u0635\u06cc\u060c \u0627\u0645\u0646 \u0648 \u0645\u0637\u0645\u0626\u0646 \u0631\u0627 \u0628\u0647 \u06a9\u0627\u0631\u0628\u0631 \u0627\u0631\u0627\u0626\u0647 \u062f\u0647\u062f. \u0628\u0627 \u062a\u0648\u062c\u0647 \u0628\u0647 \u0627\u06cc\u0646\u06a9\u0647 \u0645\u062d\u0635\u0648\u0644 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0642\u0627\u0646\u0648\u0646\u06cc \u0648 \u0645\u0628\u062a\u0646\u06cc \u0628\u0631 \u0642\u0648\u0627\u0646\u06cc\u0646 \u062a\u062c\u0627\u0631\u062a \u0627\u0644\u06a9\u062a\u0631\u0648\u0646\u06cc\u06a9 \u0627\u0633\u062a\u060c \u0628\u0631\u0627\u06cc \u0631\u0633\u06cc\u062f\u06af\u06cc \u0633\u0631\u06cc\u0639\u200c\u062a\u0631 \u0628\u0647 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u06a9\u0627\u0631\u0628\u0631\u0627\u0646\u060c \u0627\u0637\u0644\u0627\u0639\u0627\u062a\u06cc \u0645\u062b\u0644 \u0634\u0645\u0627\u0631\u0647 \u062a\u0644\u0641\u0646 \u0627\u0632 \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u062f\u0631\u062e\u0648\u0627\u0633\u062a \u0645\u06cc \u06af\u0631\u062f\u062f.\r\n\r\n\u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u062d\u0641\u0638 \u062d\u0631\u06cc\u0645 \u062e\u0635\u0648\u0635\u06cc \u06a9\u0627\u0631\u0628\u0631\u0627\u0646 \u0648 \u062d\u0641\u0627\u0638\u062a \u0627\u0632 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0634\u062e\u0635\u06cc \u0622\u0646\u0647\u0627 \u0627\u0632 \u0627\u0647\u0645\u06cc\u062a \u0628\u0627\u0644\u0627\u06cc\u06cc \u0628\u0631\u062e\u0648\u0631\u062f\u0627\u0631 \u0627\u0633\u062a. \u0627\u06cc\u0646 \u0628\u062e\u0634 \u062a\u0648\u0636\u06cc\u062d \u0645\u06cc\u200c\u062f\u0647\u062f \u06a9\u0647 \u0686\u06af\u0648\u0646\u0647 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0634\u0645\u0627 \u062c\u0645\u0639\u200c\u0622\u0648\u0631\u06cc\u060c \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0648 \u0645\u062d\u0627\u0641\u0638\u062a \u0645\u06cc\u200c\u0634\u0648\u062f.\r\n\r\n\n\n"
