                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062a\u0646\u0647\u0627 \u06cc\u06a9 \u0628\u0633\u062a\u0631 \u0627\u0631\u062a\u0628\u0627\u0637\u06cc \u0645\u06cc\u0627\u0646 \u0645\u06cc\u0632\u0628\u0627\u0646 \u0648 \u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627\u06cc \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647\u200c\u0645\u062f\u062a \u0627\u0633\u062a \u0648 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u00ab\u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u062f\u0645\u0627\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a\u00bb \u0645\u062d\u0633\u0648\u0628 \u0646\u0645\u06cc\u200c\u0634\u0648\u062f. \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0645\u06cc\u0632\u0628\u0627\u0646 \u0628\u0627 \u0622\u06af\u0627\u0647\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u0641\u0639\u0627\u0644\u06cc\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0645\u062f\u06cc\u0631\u06cc\u062a \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647 \u062e\u0648\u062f \u0631\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u200c\u062f\u0647\u062f. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062f\u0631 \u062c\u0647\u062a \u0628\u0647\u0628\u0648\u062f \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u0646\u0647\u0627\u06cc\u062a \u062a\u0644\u0627\u0634 \u062e\u0648\u062f \u0631\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f."
                            : "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062a\u0646\u0647\u0627 \u06cc\u06a9 \u0628\u0633\u062a\u0631 \u0627\u0631\u062a\u0628\u0627\u0637\u06cc \u0645\u06cc\u0627\u0646 \u0645\u06cc\u0632\u0628\u0627\u0646 \u0648 \u067e\u0644\u062a\u0641\u0631\u0645\u200c\u0647\u0627\u06cc \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647\u200c\u0645\u062f\u062a \u0627\u0633\u062a \u0648 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u00ab\u0627\u0631\u0627\u0626\u0647\u200c\u062f\u0647\u0646\u062f\u0647 \u062e\u062f\u0645\u0627\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u062c\u0627\u0631\u0647 \u06a9\u0648\u062a\u0627\u0647 \u0645\u062f\u062a\u00bb \u0645\u062d\u0633\u0648\u0628 \u0646\u0645\u06cc\u200c\u0634\u0648\u062f. \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0645\u06cc\u0632\u0628\u0627\u0646 \u0628\u0627 \u0622\u06af\u0627\u0647\u06cc \u0646\u0633\u0628\u062a \u0628\u0647 \u0641\u0639\u0627\u0644\u06cc\u062a \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0645\u062f\u06cc\u0631\u06cc\u062a \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647 \u062e\u0648\u062f \u0631\u0627 \u0628\u0647 \u0635\u0648\u0631\u062a \u0622\u0646\u0644\u0627\u06cc\u0646 \u0627\u0646\u062c\u0627\u0645 \u0645\u06cc\u200c\u062f\u0647\u062f. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062f\u0631 \u062c\u0647\u062a \u0628\u0647\u0628\u0648\u062f \u0627\u0631\u0627\u0626\u0647 \u062e\u062f\u0645\u0627\u062a \u0646\u0647\u0627\u06cc\u062a \u062a\u0644\u0627\u0634 \u062e\u0648\u062f \u0631\u0627 \u0645\u06cc\u200c\u06a9\u0646\u062f."}
