                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647\u200c\u0647\u0627\u06cc \u0627\u0631\u0627\u0626\u0647 \u0634\u062f\u0647 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0628\u0647 \u0635\u0648\u0631\u062a \u0645\u0633\u062a\u0642\u06cc\u0645 \u062a\u0648\u0633\u0637 \u0645\u0627\u0644\u06a9\u0627\u0646 \u0622\u0646\u200c\u0647\u0627 \u0627\u0638\u0647\u0627\u0631 \u0648 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062f\u0631\u062c \u0634\u062f\u0647 \u0627\u0633\u062a. \u0628\u0647\u200c\u0639\u0644\u062a \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u062f\u0648\u0631\u0647\u200c\u0627\u06cc \u0627\u06cc\u0646 \u0627\u0637\u0644\u0627\u0639\u0627\u062a\u060c \u062a\u0623\u06cc\u06cc\u062f \u0635\u062d\u062a \u0622\u0646\u200c\u0647\u0627 \u0628\u0631\u0639\u0647\u062f\u0647 \u0647\u0645\u0627\u0646 \u0645\u0646\u0627\u0628\u0639 \u0627\u0633\u062a. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062a\u0644\u0627\u0634 \u0645\u06cc\u200c\u06a9\u0646\u062f \u062a\u0627 \u062f\u0631 \u0635\u0648\u0631\u062a \u0646\u06cc\u0627\u0632\u060c \u0627\u06cc\u0646 \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u0631\u0627 \u062f\u0631 \u06a9\u0645\u062a\u0631\u06cc\u0646 \u0632\u0645\u0627\u0646 \u0645\u0645\u06a9\u0646 \u0628\u0647\u200c\u0631\u0648\u0632\u0631\u0633\u0627\u0646\u06cc \u06a9\u0646\u062f."
                            : "\u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647\u200c\u0647\u0627\u06cc \u0627\u0631\u0627\u0626\u0647 \u0634\u062f\u0647 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646\u060c \u0628\u0647 \u0635\u0648\u0631\u062a \u0645\u0633\u062a\u0642\u06cc\u0645 \u062a\u0648\u0633\u0637 \u0645\u0627\u0644\u06a9\u0627\u0646 \u0622\u0646\u200c\u0647\u0627 \u0627\u0638\u0647\u0627\u0631 \u0648 \u062f\u0631 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062f\u0631\u062c \u0634\u062f\u0647 \u0627\u0633\u062a. \u0628\u0647\u200c\u0639\u0644\u062a \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u062f\u0648\u0631\u0647\u200c\u0627\u06cc \u0627\u06cc\u0646 \u0627\u0637\u0644\u0627\u0639\u0627\u062a\u060c \u062a\u0623\u06cc\u06cc\u062f \u0635\u062d\u062a \u0622\u0646\u200c\u0647\u0627 \u0628\u0631\u0639\u0647\u062f\u0647 \u0647\u0645\u0627\u0646 \u0645\u0646\u0627\u0628\u0639 \u0627\u0633\u062a. \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u062a\u0644\u0627\u0634 \u0645\u06cc\u200c\u06a9\u0646\u062f \u062a\u0627 \u062f\u0631 \u0635\u0648\u0631\u062a \u0646\u06cc\u0627\u0632\u060c \u0627\u06cc\u0646 \u062a\u063a\u06cc\u06cc\u0631\u0627\u062a \u0631\u0627 \u062f\u0631 \u06a9\u0645\u062a\u0631\u06cc\u0646 \u0632\u0645\u0627\u0646 \u0645\u0645\u06a9\u0646 \u0628\u0647\u200c\u0631\u0648\u0632\u0631\u0633\u0627\u0646\u06cc \u06a9\u0646\u062f."}
