                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u062f\u0631 \u0645\u0648\u0627\u0631\u062f\u06cc \u0646\u0627\u062f\u0631\u060c \u0628\u0631\u0627\u06cc \u0631\u0633\u06cc\u062f\u06af\u06cc \u0648 \u062d\u0644 \u06cc\u06a9 \u0645\u0634\u06a9\u0644 \u0646\u06cc\u0627\u0632 \u0628\u0647 \u0648\u0631\u0648\u062f \u0628\u0647 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0645\u06cc\u0632\u0628\u0627\u0646 (\u06a9\u0627\u0631\u0628\u0631) \u062f\u0631 \u067e\u0644\u062a\u0641\u0631\u0645 \u0631\u0627 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f. \u062f\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u06a9\u0627\u0631\u0634\u0646\u0627\u0633 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0628\u0627 \u0631\u0639\u0627\u06cc\u062a \u0627\u0635\u0648\u0644 \u0627\u0645\u0627\u0646\u062a\u200c\u062f\u0627\u0631\u06cc\u060c \u0628\u0647 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0648\u06cc \u0648\u0627\u0631\u062f \u0645\u06cc\u200c\u0634\u0648\u062f."
                            : "\u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0645\u06a9\u0646 \u0627\u0633\u062a \u062f\u0631 \u0645\u0648\u0627\u0631\u062f\u06cc \u0646\u0627\u062f\u0631\u060c \u0628\u0631\u0627\u06cc \u0631\u0633\u06cc\u062f\u06af\u06cc \u0648 \u062d\u0644 \u06cc\u06a9 \u0645\u0634\u06a9\u0644 \u0646\u06cc\u0627\u0632 \u0628\u0647 \u0648\u0631\u0648\u062f \u0628\u0647 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0645\u06cc\u0632\u0628\u0627\u0646 (\u06a9\u0627\u0631\u0628\u0631) \u062f\u0631 \u067e\u0644\u062a\u0641\u0631\u0645 \u0631\u0627 \u062f\u0627\u0634\u062a\u0647 \u0628\u0627\u0634\u062f. \u062f\u0631 \u0627\u06cc\u0646 \u0635\u0648\u0631\u062a \u06a9\u0627\u0631\u0634\u0646\u0627\u0633 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0628\u0627 \u0631\u0639\u0627\u06cc\u062a \u0627\u0635\u0648\u0644 \u0627\u0645\u0627\u0646\u062a\u200c\u062f\u0627\u0631\u06cc\u060c \u0628\u0647 \u062d\u0633\u0627\u0628 \u06a9\u0627\u0631\u0628\u0631\u06cc \u0648\u06cc \u0648\u0627\u0631\u062f \u0645\u06cc\u200c\u0634\u0648\u062f."}
