                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u062f\u0631 \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0627\u0642\u0627\u0645\u062a \u0645\u0647\u0645\u0627\u0646 \u062f\u0631 \u06cc\u06a9 \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647\u060c \u0639\u0645\u0644\u06cc \u062e\u0644\u0627\u0641 \u0642\u0648\u0627\u0646\u06cc\u0646 \u062c\u0645\u0647\u0648\u0631\u06cc \u0627\u0633\u0644\u0627\u0645\u06cc \u0627\u06cc\u0631\u0627\u0646 \u0627\u0646\u062c\u0627\u0645 \u0634\u0648\u062f\u060c \u0645\u0633\u0626\u0648\u0644\u06cc\u062a \u0622\u0646 \u0628\u0627 \u0634\u062e\u0635\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0645\u0631\u062a\u06a9\u0628 \u062c\u0631\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a \u0648 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06cc\u06a9 \u0633\u0631\u0648\u06cc\u0633 \u0648\u0627\u0633\u0637 \u0647\u06cc\u0686\u06af\u0648\u0646\u0647 \u0645\u0633\u0626\u0648\u0644\u06cc\u062a\u06cc \u062f\u0631 \u062e\u0635\u0648\u0635 \u062a\u062e\u0644\u0641\u0627\u062a \u06cc\u0627 \u062c\u0631\u0627\u06cc\u0645 \u0635\u0648\u0631\u062a \u06af\u0631\u0641\u062a\u0647 \u0646\u062f\u0627\u0631\u062f."
                            : "\u062f\u0631 \u0635\u0648\u0631\u062a\u06cc \u06a9\u0647 \u062f\u0631 \u0645\u062f\u062a \u0632\u0645\u0627\u0646 \u0627\u0642\u0627\u0645\u062a \u0645\u0647\u0645\u0627\u0646 \u062f\u0631 \u06cc\u06a9 \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647\u060c \u0639\u0645\u0644\u06cc \u062e\u0644\u0627\u0641 \u0642\u0648\u0627\u0646\u06cc\u0646 \u062c\u0645\u0647\u0648\u0631\u06cc \u0627\u0633\u0644\u0627\u0645\u06cc \u0627\u06cc\u0631\u0627\u0646 \u0627\u0646\u062c\u0627\u0645 \u0634\u0648\u062f\u060c \u0645\u0633\u0626\u0648\u0644\u06cc\u062a \u0622\u0646 \u0628\u0627 \u0634\u062e\u0635\u06cc \u0627\u0633\u062a \u06a9\u0647 \u0645\u0631\u062a\u06a9\u0628 \u062c\u0631\u0645 \u0634\u062f\u0647 \u0627\u0633\u062a \u0648 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0628\u0647 \u0639\u0646\u0648\u0627\u0646 \u06cc\u06a9 \u0633\u0631\u0648\u06cc\u0633 \u0648\u0627\u0633\u0637 \u0647\u06cc\u0686\u06af\u0648\u0646\u0647 \u0645\u0633\u0626\u0648\u0644\u06cc\u062a\u06cc \u062f\u0631 \u062e\u0635\u0648\u0635 \u062a\u062e\u0644\u0641\u0627\u062a \u06cc\u0627 \u062c\u0631\u0627\u06cc\u0645 \u0635\u0648\u0631\u062a \u06af\u0631\u0641\u062a\u0647 \u0646\u062f\u0627\u0631\u062f."}
