                          {hasVariant(globalVariants, "screen", "mobile")
                            ? "\u062a\u0628\u0639\u0627\u062a \u062a\u0635\u0645\u06cc\u0645\u200c\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u06cc\u0632\u0628\u0627\u0646 \u0628\u0631\u0627\u06cc \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647 \u062e\u0648\u062f \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f\u060c \u0645\u062b\u0644 \u0646\u0631\u062e\u200c\u06af\u0630\u0627\u0631\u06cc\u060c \u062a\u062e\u0641\u06cc\u0641\u060c \u0644\u063a\u0648 \u0631\u0632\u0631\u0648 \u0648\u2026 \u0628\u0631 \u0639\u0647\u062f\u0647 \u062e\u0648\u062f \u0648\u06cc \u0628\u0648\u062f\u0647 \u0648 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0633\u0626\u0648\u0644\u06cc \u062f\u0631 \u0642\u0628\u0627\u0644 \u0627\u06cc\u0646 \u0627\u0642\u062f\u0627\u0645\u0627\u062a \u0648 \u0646\u062a\u0627\u06cc\u062c \u0622\u0646 \u0646\u062f\u0627\u0631\u062f."
                            : "\u062a\u0628\u0639\u0627\u062a \u062a\u0635\u0645\u06cc\u0645\u200c\u0647\u0627\u06cc\u06cc \u06a9\u0647 \u0645\u06cc\u0632\u0628\u0627\u0646 \u0628\u0631\u0627\u06cc \u0627\u0642\u0627\u0645\u062a\u06af\u0627\u0647 \u062e\u0648\u062f \u0645\u06cc\u200c\u06af\u06cc\u0631\u062f\u060c \u0645\u062b\u0644 \u0646\u0631\u062e\u200c\u06af\u0630\u0627\u0631\u06cc\u060c \u062a\u062e\u0641\u06cc\u0641\u060c \u0644\u063a\u0648 \u0631\u0632\u0631\u0648 \u0648\u2026 \u0628\u0631 \u0639\u0647\u062f\u0647 \u062e\u0648\u062f \u0648\u06cc \u0628\u0648\u062f\u0647 \u0648 \u0631\u0646\u062a\u0627\u0645\u0648\u0646 \u0645\u0633\u0626\u0648\u0644\u06cc \u062f\u0631 \u0642\u0628\u0627\u0644 \u0627\u06cc\u0646 \u0627\u0642\u062f\u0627\u0645\u0627\u062a \u0648 \u0646\u062a\u0627\u06cc\u062c \u0622\u0646 \u0646\u062f\u0627\u0631\u062f."}
